import React, { useState } from 'react';
import styled, { keyframes } from 'styled-components';
import axios from 'axios';

const rotate = keyframes`
  from { transform: rotate(0deg); }
  to { transform: rotate(360deg); }
`;

const shine = keyframes`
  0% { background-position: 200% center; }
  100% { background-position: -200% center; }
`;

const fadeIn = keyframes`
  from { opacity: 0; transform: translateY(20px); }
  to { opacity: 1; transform: translateY(0); }
`;

const Container = styled.div`
  min-height: 100vh;
  background: linear-gradient(135deg, #0a192f 0%, #0d1b2a 100%);
  color: white;
`;

const Nav = styled.nav`
  padding: 1.5rem 2rem;
  display: flex;
  justify-content: space-between;
  align-items: center;
  background: rgba(13, 27, 42, 0.8);
  backdrop-filter: blur(10px);
  position: fixed;
  width: 100%;
  z-index: 100;
`;

const Logo = styled.div`
  font-size: 1.5rem;
  font-weight: bold;
  background: linear-gradient(90deg, #00a3ff, #00ff87);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
`;

const MainSection = styled.section`
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  padding: 2rem;
  text-align: center;
`;

const Title = styled.h1`
  font-size: 3.5rem;
  margin-bottom: 1rem;
  background: linear-gradient(90deg, #00a3ff, #00ff87, #00a3ff);
  background-size: 200% auto;
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  animation: ${shine} 3s linear infinite;
`;

const Subtitle = styled.p`
  font-size: 1.2rem;
  max-width: 600px;
  margin: 0 auto 2rem;
  color: #8892b0;
  animation: ${fadeIn} 1s ease-out;
`;

const FeatureSection = styled.section`
  padding: 4rem 2rem;
  background: rgba(13, 27, 42, 0.5);
`;

const FeatureGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 2rem;
  max-width: 1200px;
  margin: 0 auto;
`;

const FeatureCard = styled.div`
  padding: 2rem;
  background: rgba(255, 255, 255, 0.05);
  border-radius: 10px;
  backdrop-filter: blur(5px);
  transition: transform 0.3s ease;
  animation: ${fadeIn} 1s ease-out;

  &:hover {
    transform: translateY(-5px);
  }
`;

const DemoSection = styled.section`
  padding: 4rem 2rem;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const DiscContainer = styled.div`
  width: 300px;
  height: 300px;
  position: relative;
  margin: 2rem 0;
`;

const Disc = styled.div`
  width: 100%;
  height: 100%;
  border-radius: 50%;
  position: absolute;
  background: linear-gradient(45deg, #00a3ff, #00ff87);
  animation: ${rotate} 8s linear infinite;
  &::before {
    content: '';
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    width: 80%;
    height: 80%;
    background: #0a192f;
    border-radius: 50%;
  }
  &::after {
    content: '';
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    width: 20%;
    height: 20%;
    background: #00a3ff;
    border-radius: 50%;
    box-shadow: 0 0 20px #00a3ff;
  }
`;

const CallButton = styled.button`
  padding: 1rem 2.5rem;
  font-size: 1.2rem;
  background: linear-gradient(45deg, #00a3ff, #00ff87);
  border: none;
  border-radius: 30px;
  color: #0a192f;
  font-weight: 600;
  cursor: pointer;
  transition: all 0.3s ease;

  &:hover {
    transform: scale(1.05);
    box-shadow: 0 0 20px rgba(0, 163, 255, 0.4);
  }

  &:disabled {
    opacity: 0.7;
    cursor: not-allowed;
  }
`;

const StatusText = styled.p`
  color: #00ff87;
  font-size: 1.1rem;
  margin-top: 1rem;
  height: 1.5rem;
`;

function App() {
  const [isLoading, setIsLoading] = useState(false);
  const [status, setStatus] = useState('');

  const initiateCall = async () => {
    setIsLoading(true);
    setStatus('Initiating call...');
    try {
      const response = await axios.post('https://31ce-103-159-45-178.ngrok-free.app/make-call', {
        phoneNumber: '+919845503430'
      });
      if (response.data.success) {
        setStatus('Call initiated successfully!');
      } else {
        setStatus('Failed to initiate call');
      }
    } catch (error) {
      console.error('Error:', error);
      setStatus('Error initiating call');
    }
    setIsLoading(false);
  };

  return (
    <Container>
      <Nav>
        <Logo>Call Assistant</Logo>
      </Nav>

      <MainSection>
        <Title>AI Call Assistant</Title>
        <Subtitle>
          Experience the future of communication with our advanced AI voice assistant.
          Natural conversations, intelligent responses, and seamless interaction.
        </Subtitle>
      </MainSection>

      <FeatureSection>
        <FeatureGrid>
          <FeatureCard>
            <h3>Natural Conversation</h3>
            <p>Engage in fluid, human-like conversations with advanced AI technology</p>
          </FeatureCard>
          <FeatureCard>
            <h3>Real-time Responses</h3>
            <p>Get instant, intelligent responses powered by GPT-4</p>
          </FeatureCard>
          <FeatureCard>
            <h3>Voice Integration</h3>
            <p>Seamless voice recognition and natural speech synthesis</p>
          </FeatureCard>
        </FeatureGrid>
      </FeatureSection>

      <DemoSection>
        <h2>Try It Now</h2>
        <DiscContainer>
          <Disc />
        </DiscContainer>
        <CallButton onClick={initiateCall} disabled={isLoading}>
          {isLoading ? 'Initiating...' : 'Start Conversation'}
        </CallButton>
        <StatusText>{status}</StatusText>
      </DemoSection>
    </Container>
  );
}

export default App;
